import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div>
      <header className='black_h1'>
        <h1>
          개발자 Blog 추천
        </h1>
      </header>
      <nav>
        <ol>
          <li>velog를 사용할까?</li>
          <li>Tistory를 사용할까?</li>
          <li>GitHub Blog를 사용할까?</li>
        </ol>
      </nav>
    </div>
  );
}

export default App;
